import { Component } from "react";
import ima from "./images";

class List extends Component{
    render(){
        return (
            <div>
                <images/>
                <ol>
                    <li>satu</li>
                    <li>dua</li>
                    <li>tiga</li>
                </ol>
            </div>
        )
    };
} export default List;
